const dataset = {
    header:{
        nav:[
            {title: "할인상품"},
            {title: "베스트"},
            {title: "우먼"},
            {title: "맨"},
            {title: "컬래버레이션"},
            {title: "키즈"},
            {title: "커뮤니티"},
            {title: "런칭 캘린더"},
            {title: "매거진"}
        ],
        navHover:[
            {common: ["신상품", "베스트", "전체보기"]},
            {woman: ["아우터"]}
        ]
    },
}

export default dataset;
